    false,nt"url": null,nt"notes": "Marine Bird Habitats (F040) is one of a
    group of seven datasets related tonMarine Birds from Coastal Alaska and Puget Sound
    Data (1975 -1978). Eachndataset uses the NODC Taxonomic Code to indicate species.nnMarine
    Bird Habitats (F040) data type contains data from fieldnobservations of marine bird
    species and their associated habitats. Thendata are collected to provide information
    about species abundance,ndistribution and behavior. Position, date, time, elapsed
    survey time,narea and distance, platform type and sampling technique are reported
    forneach survey. Environmental information may include meteorologicalnconditions,
    sea surface temperature and salinity, tide conditions andnice characteristics. Species
    and habitat information may include numbernof species, number of individuals per
    species, age, sex, color, molt,nbehavior, physiographic features, substrate, cover
    and distances tonshore, barrier islands, or river deltas. These data were collected
    inn1975 - 1978 for coastal Alaska.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
